import React from "react";
import './Home.css';
import AttributeItem from './AttributeItem';

const Attributes = () => {
  const linkPhoto = "https://create.adobe.com/2013/10/1/long_exposure_photography_of_toby_harriman/jcr:content/article-body/full_width_images/image1.img.jpg/1567809082430.jpg";

  return (
    <div class="row">
      <div class="col-sm-6">
        <div class="card">
          <AttributeItem image={linkPhoto} title="Special title treatment"
            text="With supporting text below as a natural lead-in to additional content."/>
        </div>
      </div>
      <div class="col-sm-6">
        <div class="card">
          <AttributeItem image={linkPhoto} title="Special title treatment"
            text="With supporting text below as a natural lead-in to additional content."/>
        </div>
      </div>
    </div>
  );
}

export default Attributes;
